import React, { useState } from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import './css/NavBarPrueba.css'; // Archivo CSS
import Logo from '../../Assets/Img_Home/Logo.png';

const NavBarPrueba = () => {

    const [burger_class, setBurgerClass] = useState("burger-bar unclicked")
    const [menu_class, setMenuClass] = useState("menu hidden")
    const [isMenuClicked, setIsMenuClicked] = useState(false)

    const updateMenu = () =>{
        if(!isMenuClicked){
            setBurgerClass("burguer-bar clicked")
            setMenuClass("menu-visible")
        }
        else{
            setBurgerClass("burguer-bar unclicked")
            setMenuClass("menu hidden")
        }
    }
    

    return(
            <header>
                <img className="logo" src={Logo} alt="InnoVenta Logo" />
                <button id="abrir" className="abrir-menu" >
                    <i className="bi bi-list"></i>
                </button>
                <nav className={`nav-1  'visible' `} id="nav-1">
                    <button id="cerrar" className="cerrar-menu" >
                        <i className="bi bi-x-circle"></i>
                    </button>
                    <ul className="nav-list">
                        <li><a href="#">Inicio</a></li>
                        <li><a href="#">Membresia</a></li>
                        <li><a href="#">Productos</a></li>
                        <li><a href="#">Contacto</a></li>
                    </ul>
                </nav>
                <button className="fondo-boton letra-boton desactivacion-boton">Comenzar</button>
            </header>
    )
};

export default NavBarPrueba;
